import React, { useEffect } from 'react';
import './Home.css';
import { motion } from 'framer-motion';

export default function Home() {

    useEffect(() => {
        const createPetal = () => {
            const petal = document.createElement('div');
            petal.className = 'petal';
            petal.style.left = Math.random() * 100 + 'vw';
            petal.style.animationDuration = (Math.random() * 5 + 5) + 's';
            document.body.appendChild(petal);

            setTimeout(() => {
                petal.remove();
            }, 10000);
        };

        setInterval(createPetal, 300);
    }, []);

    return (
        <div className="home-container">
            <motion.h1 
                initial={{ y: -100, opacity: 0 }}
                animate={{ y: 0, opacity: 1 }}
                transition={{ duration: 1 }}
            >
                Blooming Beauty AI
            </motion.h1>
            <motion.p 
                initial={{ x: -100, opacity: 0 }}
                animate={{ x: 0, opacity: 1 }}
                transition={{ duration: 1.5 }}
            >
                An advanced AI content moderation system with the elegance of nature.
            </motion.p>
            <motion.button
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
                onClick={() => alert('Welcome to our beautiful world!')}
            >
                Explore Now
            </motion.button>
            <motion.div className="card"
                initial={{ scale: 0.5, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                transition={{ duration: 1.2 }}
            >
                <h3>Discover AI's Elegance</h3>
                <p>Experience the harmonious blend of technology and nature.</p>
            </motion.div>
        </div>
    );
}
